import * as React from "react";
import './Schedule.css';
import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';
import Paper from '@mui/material/Paper';
import { ViewState } from '@devexpress/dx-react-scheduler';
import {
  Scheduler,
  DayView,
  Appointments,
  CurrentTimeIndicator
} from '@devexpress/dx-react-scheduler-material-ui';

const top100Films = ['coupe','barbe'];
const currentDate = '2022-03-29';
const schedulerData = [
  { startDate: '2022-03-29T10:20', endDate: '2022-03-29T11:00', title: 'taken' },
  { startDate: '2022-03-29T12:00', endDate: '2022-03-29T13:30', title: 'taken' },
];
const Appointment = ({
    children, style, isShaded, ...restProps
  }) => (
    <Appointments.Appointment
      {...restProps}

      style={{
        ...style,
        backgroundColor: '#939393',
        borderRadius: '8px',
      }}
    >
      {children}
    </Appointments.Appointment>
  );

class Schedule extends React.Component{
    render(){
        return(
            <div className="Schedule">
              <h1>Schedule</h1>
                <div className="hour">
                  <Scheduler data={schedulerData} >
                      <ViewState currentDate={currentDate} />
                      <DayView
                          startDayHour={10}
                          endDayHour={20}
                      />
                      <Appointments
                          appointmentComponent={Appointment}
                      />
                      <CurrentTimeIndicator
                        shadePreviousCells={true}
                        shadePreviousAppointments={true}
                        updateInterval={true}
                      />
                    </Scheduler>
                </div>
                <div className="form">
                  <p>Choose service and time</p>
                  <Autocomplete
                    id="combo-box-demo"
                    options={top100Films}

                    style={{ width: 300 }}
                    renderInput={(params) => <TextField {...params} label="Choose the service" variant="outlined" />}
                  />
                  <p>Time Picker</p>
                </div>
            </div>

        )
    }
}

export default Schedule;
